import React from "react";


const Chatss = () => {
  return (
    <div className="Chatss">
      <div className="userchat">
        <img src="https://a.pinatafarm.com/500x500/c501ff63ac/advice-dog.jpg" alt=""/>
        <div className="userchatinfo">
          <span>Bigge</span>
        </div>
      </div>
    </div>
  );
};

export default Chatss;
